    application.  The vendor application failed to detect and prevent the excessive
    contribution.  Upon discovering the contribution, the Committee immediately contacted
    the donor to remedy the excessive portion of the contribution.  A refund of $22,700
    was issued to the donor on 7/7/2008 consistent with CFR 103.3(b)(3).  Additional
    safeguards have been put in place for the online credit card application to prevent
    further instances of this type of activity."
